import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Router } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {

  constructor(private router: Router) {

  }

  pages: String[] = ["Home", "Nutricionista", "Agenda", "Categoria", "Consulta", "Controle"];


  direcionarPagina(pagina: String) {

    for (var page in this.pages) {
      if (this.pages[page].toLocaleLowerCase() === pagina.toLocaleLowerCase()) {
        console.log("Entrou e clicou")
        this.router.navigate([pagina.toLowerCase()])
      }
    }

  }
}
